import React from 'react';
import { MapTo } from '@adobe/aem-react-editable-components';

require('./index.css')

export const HomePage = ({ title, subtitle, logoImage = {}, backgroundImage = {} }) => {
    return (
        <>
            <header>
                <h1>header</h1>

            </header>
            <body>
                <h1>body</h1>

            </body>
            <footer>
                <h1>footer</h1>
            </footer>
        </>
    )
}

export default MapTo('reactapp/components/home-page')(HomePage);
